import React from 'react';
import './App.css';

import Header from './components/Header';
import Footer from './components/Footer';
// import Contact from './components/contact';

class App extends React.component {
  render() {
    return (
      <div className="app">
        <Header />
        <Footer />
      </div>
    )
  }
}


export default App;
